import React from 'react';
import logo from '../../logo.svg';
import './App.css';


function App() {
  let data = {
    "1":{name: "Jesus", lastName: "Sicairos", age: "25", location: "London, England"},
    "2":{name: "Ramon", lastName: "Lopez", age: "25", location: "Sinaloa, Mexico"}
  }

  const obj = data.map(comp => <product product={comp}/>)
  return (
    <div className="App">
        <p>{obj}</p>
    </div>
  );
}

export default App;
